from random import random, choice, shuffle, randint
def makeGraph(size):
    nodes = ["v" + str(i) for i in range(size)]
    shuffle(nodes)
    edges = []
    for i in range(len(nodes)-1):
        edges.append([nodes[i], nodes[i+1], round(random()*0.8+0.1, 2)])
        for i in range(randint(1, 3)):
            other = choice(nodes)
            while other == nodes[i]:
                other = choice(nodes)
            edges.append([nodes[i], other, round(random()*0.8+0.1, 2)])
    return (nodes, edges)

n = 250

G = makeGraph(n)
nodesList = G[0]
edgesList = G[1]

nodes = ""
edges = ""

for node in nodesList:
    nodes += node + ", "

for edge in edgesList:
    edges += edge[0] + "-" + edge[1] + "-" + str(edge[2]) + ", "

print("NODES:   " + nodes[:-2])
print("EDGES:   " + edges[:-2])

